select(2, ...).LoadData("APP_INFO","Global",[[return {version=404,lastSync=1592129565,message={id=0,msg=""},news={{title="TSM 4.10 Change Log",content="We're very excited to share the following work-in-progress list of changes you can expect in TSM 4.10. Over the coming weeks we'll deep-dive and highlight some of these new features in future blog posts. You can register your interest to participate in the upcoming TSM 4.10 beta test by visiting this sign-up page, or guarantee [...]",timestamp=1591122732,link="https://blog.tradeskillmaster.com/tsm-4-10-change-log/"},{title="TradeSkillMaster v4.9.35 Changelog",content="TSM v4.9.35 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [All] Fixed error when loading very old settings<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1589397480,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-35-changelog/"},{title="TradeSkillMaster v4.9.34 Changelog",content="TSM v4.9.34 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [All] Tweaked how TSM stores item info and settings<br />* [Retail] Fixed issue with auctions not displaying when the user has a token posted<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1589133504,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-34-changelog/"},{title="TradeSkillMaster v4.9.33 Changelog",content="TSM v4.9.33 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [All] Updated hard-coded vendor sell prices for crafting mats<br />* [All] Fixed issue with Accounting incorrectly reporting unique items which couldn't be retrieved from the mail<br />* [Retail] Fixed errors when using the queue with a garrison profession open<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1588699578,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-33-changelog/"}}}]]) --<APP_INFO,Global,1592129565>
